define( [
	'../../../../bower_components/underscore/underscore',
	'backbone',
	'config'
], function( _, Backbone, Config ){
    var SearchModel = Backbone.Model.extend( {
			url: function() {
				return Config.apiURL + '/instructors/' + this.id;
			},
			defaults: function() {
				return {
					id: '',
					type: '',
					name: '',
					postcode: '',
					latitude: '',
					longitude: '',
					path: []
				};
			}
    } );
    return SearchModel;
});
